import React from 'react';
import BluetoothComponent from './components/BluetoothComponent';
import useOpenAI from './hooks/useOpenAI';

const App: React.FC = () => {
  const aiResponse = useOpenAI();

  return (
    <div className='bg-gray-500'>
      <BluetoothComponent />
      {aiResponse && (
        <div>
          <p>AI Response:</p>
          <p>{aiResponse}</p>
        </div>
      )}
    </div>
  );
};

export default App;
